import React from "react";
import Textfield from "../Textfield/Textfield";
import Todowrapper from "../Todowrapper/Todowrapper";
import "./Box.css";

export default () => {
  return (
    <div className="box">
      <Todowrapper />
      <input className="btn" type="button">
          +
      </input>
      <Textfield />
    </div>
  );
};
